import React, { useState } from 'react';
import eyeIcon from '../public/eye-icon.svg'; // Assurez-vous que le chemin est correct

function InputMdp() {
  const [showPassword, setShowPassword] = useState(false);

  const togglePasswordVisibility = () => {
    setShowPassword(!showPassword);
  };

  return (
    <div>
      <input type={showPassword ? "text" : "password"} />
      <img src={eyeIcon} alt="Toggle Password Visibility" onClick={togglePasswordVisibility} />
    </div>
  );
}

export default InputMdp;
